import frame from '../static/images/Frame.png'
import image10 from '../static/images/image 10.png'

export default function LoginSignUp() {
    return (
        <div style={{ display: 'flex', margin: "0", alignItems: "center", justifyContent: "center" }}>
            <img src={image10} alt='10' style={{marginLeft:"20"}}/>
            <div style={{ display: 'flex', width: "100%" }}>
                <img src={frame} alt='frame' style={{ width: "24px", height: "24px", marginTop: "2%" }} />
                <h4 style={{ marginLeft: "1%" }}>User Interface Enhancement for Access Database</h4>
            </div>
        </div>
    )
}
